import Router from './components/Router';
import UserContext from './context/UserContext';
// import './card.css'

function App() {
  return (
    <ThemeContext.Provider value={{ color: 'dark' }}>

      <div className="App">
        <Router />
      </div>
    </ThemeContext.Provider>
  );
}

export default App;
